import React from 'react'

const OtherDraftItem = () => {
  return (
    <div className='flex basis-1/2 flex-col h-[104px] p-3 border rounded-xl text-[12px] hover:bg-[#e5e6e7] cursor-pointer  hover:drop-shadow-xl transition-all'>
      <span className='w-[56px]  bg-[#e8eaed] rounded-xl text-center '>Draft 1</span>
      <p className='pt-2'>Hi there! How can I help you today?</p>
    </div>
  )
}

export default OtherDraftItem
